import { Component } from '@angular/core';
import { MatSnackBar } from '@angular/material/snack-bar';
import { RequestService } from '../services/request.service';
import { ActivatedRoute, Router } from '@angular/router';
import { Request } from '../request';
import {Location} from '@angular/common';

@Component({
  selector: 'app-create-solicitud',
  templateUrl: './create-solicitud.component.html',
  styleUrls: ['./create-solicitud.component.css']
})
export class CreateSolicitudComponent {

  request : Request = new Request();
  create: boolean = true;
  requestId: number = 0;
  constructor(private requestService: RequestService,
    private snackbar: MatSnackBar,
    private router: Router,
    private route: ActivatedRoute,
    private _location: Location) { }

    ngOnInit(): void {
      if (this.route.snapshot.paramMap.has('id')){
        this.requestId = Number(this.route.snapshot.paramMap.get('id'));
        this.create=false;
      }

      if (!this.create){
        this.requestService.getAccount(this.requestId).subscribe({
          next: (data: any) => {
            this.request = <Request> data;
          },
          error: (e: any) => {
            this.snackbar.open('Error communicating with the server', '', {
              duration: 3000
            });
          }
        });
      }

  }
  back() {
    this._location.back();
  }
  onSubmit(request: Request) {
    if (this.create){
        this.requestService.createAccount(this.request).subscribe({
        next: (any) => {
          this.router.navigateByUrl('/cuentas');
            this.snackbar.open('Cuenta created ', '', {
            duration: 3000
            });
        },
        error: (e: any) => {
          this.snackbar.open('Error creating the cuenta: '+e.error, '', {
            duration: 3000
          });
        }
      });
    }else{
      this.requestService.updateAccount(this.request).subscribe({
        next: (any) => {
          this.router.navigateByUrl('/request');
            this.snackbar.open('Cuenta updated ', '', {
            duration: 3000
            });
        },
        error: (e: any) => {
          this.snackbar.open('Error updating the cuenta: '+e.error, '', {
            duration: 3000
          });
        }
      });
    }

  }
}

<div class="container">
    <mat-card>
        <mat-card-title>
            <div *ngIf="create">Create Solicitud</div>
            <div *ngIf="!create">Edit Solicitud {{request.id}}</div>
        </mat-card-title>

        <form class="create-model-form" #form="ngForm" (ngSubmit)="onSubmit(form.value)" autocomplete="off">
            <mat-form-field *ngIf="!create" class="full-width">
                <input matInput type="number"  disabled name="id" [(ngModel)]="request.id">
            </mat-form-field>

            <mat-form-field class="full-width">
                <mat-label>Medicamentos</mat-label>
                <mat-select name="medicamentos" [(ngModel)]="request.medicamentos" multiple>
                    <mat-option *ngFor="let medicamento of listaMedicamentos" [value]="medicamento">
                        {{ medicamento }}
                    </mat-option>
                </mat-select>
            </mat-form-field>
            <br>
            <mat-form-field class="full-width">
                <input matInput type="number" placeholder="Ruta" required name="ruta"  [(ngModel)]="request.Id_ruta">
            </mat-form-field>
            <br>
            <div class="row-buttons">
                <span class="spacer"></span>
                <a (click)="back()" class="form-btn" mat-button>Go Back</a>
                <button type="submit" class="form-btn" [disabled]="form.invalid" mat-raised-button color="accent">
                <div *ngIf="create">Create</div>
                <div *ngIf="!create">Edit</div>
                </button>
            </div>          
        </form> 
    </mat-card>
</div>
